longDescription:
Equity ratio for public and private-not-for profit institutions using FASB standards is derived as follows:

Total net assets (F2A06) divided by total assets (F2A02)

Net assets are the excess of assets over liabilities or the residual interest in the institution's assets remaining after liabilities are deducted. The change in net assets results from revenues, gains, expenses, and losses. FASB institutions classify net assets into three categories: permanently restricted, temporarily restricted, and unrestricted. GASB institutions classify net assets into three categories: invested in capital, net of related debt; restricted (with separate displays of restricted-expendable and restricted-nonexpendable net assets); and unrestricted. Although the terms are similar, the composition of the categories of net assets between FASB and GASB institutions can differ significantly. 

Total assets include  
a) Cash, cash equivalents, and temporary investments;
b) Receivables (net of allowance for uncollectible amounts); 
c) Inventories, prepaid expenses, and deferred charges; 
d) Amounts held by trustees for construction and debt service; 
e) Long-term investments; 
f) Plant, property, and equipment; and, 
g) Other assets
